import "./Profile.css";

const Profile = ({name = '', age, country}) => {
  return (
    <div className="profile">
      <h3>Name: {name}</h3>
      <h3>Age: {age}</h3>
      <h3>From: {country}</h3>
    </div>
  );
};


export default Profile;
